  list-style: none;
  overflow: hidden;
}
#navet .header ul a {
  display: flex;
  margin-bottom: 15px;
  text-decoration: none;
  justify-content: center;
  text-align: center;
  font-weight: 600;
}
#navet .header .menu {
  clear: both;
  max-height: 0;
  transition: max-height 0.2s ease-out;
}
#navet .header .menu-icon {
  padding: 20px 20px;
  position: relative;
  float: left;
  cursor: pointer;
}
#navet .header .menu-icon .nav-icon {
  background: #2595be;
  display: block;
  height: 5px;
  width: 30px;
  position: relative;
  border-radius: 10px;
  transition: background 0.2s ease-out;
}
#navet .header .menu-icon .nav-icon:before {
  background: #2595be;
  content: "";
  display: block;
  height: 100%;
  width: 100%;
  border-radius: 10px;
  position: absolute;
  transition: all 0.2s ease-out;
  top: 10px;
}
#navet .header .menu-icon .nav-icon:after {
  background: #2595be;
  content: "";
  display: block;
  height: 100%;
  width: 100%;
  border-radius: 10px;
  position: absolute;
  transition: all 0.2s ease-out;
  top: -10px;
}
#navet .header .menu-btn {
  display: none;
}
#navet .header .menu-btn:checked ~ .menu {
  max-height: 240px;
}
#navet .header .menu-btn:checked ~ .menu-icon .nav-icon {
  background: transparent;
}
#navet .header .menu-btn:checked ~ .menu-icon .nav-icon:before {
  transform: rotate(-45deg);
  top: 0;
}
#navet .header .menu-btn:checked ~ .menu-icon .nav-icon:after {
  transform: rotate(45deg);
  top: 0;
}
