	}

	.header .menu {
		clear: both;
		max-height: 0;
		transition: max-height 0.2s ease-out;
	}

	.header .menu-icon {
		padding: 20px 20px;
		position: relative;
		float: left;
		cursor: pointer;
	}

	.header .menu-icon .nav-icon {
		background: #2595be;
		display: block;
		height: 5px;
		width: 30px;
		position: relative;
		border-radius: 10px;
		transition: background 0.2s ease-out;
	}

	.header .menu-icon .nav-icon:before {
		background: #2595be;
		content: "";
		display: block;
		height: 100%;
		width: 100%;
		border-radius: 10px;
		position: absolute;
		transition: all 0.2s ease-out;
		top: 10px;
	}

	.header .menu-icon .nav-icon:after {
		background: #2595be;
		content: "";
		display: block;
		height: 100%;
		width: 100%;
		border-radius: 10px;
		position: absolute;
		transition: all 0.2s ease-out;
		top: -10px;
	}

	.header .menu-btn {
		display: none;
	}

	.header .menu-btn:checked ~ .menu {
		max-height: 240px;
	}

	.header .menu-btn:checked ~ .menu-icon .nav-icon {
		background: transparent;
	}

	.header .menu-btn:checked ~ .menu-icon .nav-icon:before {
